  station data from bottle casts from the PONTCHARTRAIN from Ocean Weather Station
  C (OWS-C) in the North Atlantic Ocean from 07 September 1973 to 24 September 1973
  (NODC Accession 7400473)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
