  \"2015-09-27T02:24:08.874656\",\n\t\"name\": \"oceanographic-station-data-from-bottle-casts-from-the-pontchartrain-from-ocean-weather-station-64ae3\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Oceanographic station data were collected
  from the PONTCHARTRAIN within a 1-mile radius of Ocean Weather Station C (5245N
  0352W) and in transit. Data were collected by the United States Coast Guard (USCG)
  from 07 September 1973 to 24 September 1973. Data were processed by NODC to the
  NODC standard Station Data II Output Format (SD2). Full format description is available
  from NODC at www.nodc.noaa.gov/General/NODC-Archive/sd2.html.nnThe SD2 format contains
  physical-chemical oceanographic data recorded at discrete depth levels. Most of
  the observations were made using multi-bottle Nansen casts or other types of water
  samplers. A small amount (about 5 percent) were obtained using electronic CTD (conductivity-temperature-depth)
  or STD (salinity-temperature-depth) recorders. The CTD/STD data were reported to
  NODC at depth levels equivalent to Nansen cast data, however, and have been processed
  and stored the same as the Nansen data. Cruise information (e.g., ship, country,
  institution), position, date, and time, and reported for each station. The principal
  measured parameters and temperature and salinity , but dissolved oxygen, phosphate,
  total phosphorus, silicate, nitrate, nitrite, and pH may be reported. Meteorological
  conditions at the time of the cast (e.g., air temperature and pressure, wind, waves)
  may also be reported, as well as auxiliary data such as water color (Forel-Ule scale),
  water transparency (Secchi disk depth), and depth to bottom. Values of density (sigma-t)
  sound velocity, and dynamic depth anomaly are computed from measured parameters.
  Each station contains the measurements taken at the observed depth levels, but also
  includes data values interpolated to a set of standard depth levels.\",\n\t\"license_title\":
